import React from 'react';


const Root = () => {
    return (
        <Container className="container-1">
          <Row>
            <Col>
              <Navbar />
            </Col>
          </Row>
          <br></br>
          <Row>
            <Col>
              <ProfileCard />
            </Col>
            <Col>
              <ProfileButtons />
              <AboutMe />
            </Col>
          </Row>
        </Container>
    );
}

export default Root;
